import MealsSummary from "./MealsSummary";
import AvailableMeals from "./AvailableMeals";
import React, { Fragment } from "react";

const uploadHandler = () => {
  props.onUpload();
}
const Item = (props) => {
  return (
    <Fragment>
      <MealsSummary />
      <AvailableMeals onUpload={uploadHandler}/>
    </Fragment>
  );
};

export default Item;
